# давайте для начала оптимизируем функцию выше, а потом сделаем своё решение
# @profile
def func_3(array):
    m = 0
    num = 0
    set_array = set(array)
    for i in set_array:
        count = array.count(i)
        if count > m:
            m = count
            num = i
    return f'Чаще всего встречается число {num}, ' \
           f'оно появилось в массиве {m} раз(а)'


